import classes from "./availableMeals.module.css";

const ChickenDetails = [
  {
    id: "1",
    name: "RoseMary",
    description: "Finest Chicken, top quality",
    price: 5000,
  },
  {
    id: "2",
    name: "RoseMary",
    description: "Finest Chicken, top quality",
    price: 5000,
  },
  {
    id: "3",
    name: "RoseMary",
    description: "Finest Chicken, top quality",
    price: 5000,
  },
  {
    id: "4",
    name: "RoseMary",
    description: "Finest Chicken, top quality",
    price: 5000,
  },
  {
    id: "5",
    name: "RoseMary",
    description: "Finest Chicken, top quality",
    price: 5000,
  },
];

const AvailableChickens = () => {
  const chickenList = ChickenDetails.map((meal) => <li>meal.name</li>);
  return (
    <>
      <section className={classes.meals}>
        <ul>{chickenList}</ul>
      </section>
    </>
  );
};

export default AvailableChickens;
